import React, { useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/auth";

const ShowResult = (props) => {
  const [auth, setauth] = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    if (!auth?.token) {
      navigate("/");
    }
  }, []);
  return (
    // <div>
    //   <label htmlFor="">Your Score :{props.score}</label>
    //   <label htmlFor="">Total Score :{props.totalScore}</label>
    // </div>
    <div class="content_wraper">
      <div class="logo">
        <div class="container">
          <a target="_blank" href="https://www.inboundacademy.in/">
            <img src="images/inbound-academy-logo.webp" alt="Logo" />
          </a>
        </div>
      </div>
      <div class="body_content">
        <div class="container">
          <div class="exam_start">
            <div class="exam_result_gh">
              <div class="exam_name">
                Salesforce Administrator Certification Practice Test
              </div>
              <div class="exam_score_details">
                <div class="candidate_dt">
                  <span>
                    Passed by <strong>{auth?.user?.name}</strong>
                  </span>
                  <span>
                    Total Time: <strong>43 Minutes</strong>{" "}
                    <span>(Maximun is 50)</span>
                  </span>
                  <span>
                    Number of Qustions: <strong>20</strong>
                  </span>
                </div>
                <div class="result_box">
                  <span>Total Score:</span>
                  <div class="reult_score">
                    {auth?.score}/{auth?.length}
                  </div>
                  {auth?.score < 30 ? (
                    <span className="gd_bag">Failed</span>
                  ) : (
                    <span class="gd_bad">PASSED</span>
                  )}
                </div>
              </div>
              <div class="exam_score_dt exam_guid">
                <p>Salesforce Administrator Certification Practice Test </p>
              </div>
            </div>
            <div class="exam_start_cta text-center">
              {auth?.score >= 30 ? (
                <Link to={"payment"}>Proceed Payment</Link>
              ) : (
                ""
              )}
            </div>
          </div>
        </div>
      </div>
      <footer class="text-center">
        <div class="container">
          Copyright Â© 2023.{" "}
          <a href="https://www.transfunnel.com/" target="_blank">
            TransFunnel Consulting
          </a>
        </div>
      </footer>
    </div>
  );
};

export default ShowResult;
